import React from "react";
import rawData from "../postData.json";

const PostList = () => {

  return (
        <section className="articles">
        {Object.entries(rawData).map(([slug, { title }]) => (
        <li className="article" key={slug}>
          <h3>{title}</h3>
        </li>
        ))}
        </section>
  );
};
  
export default PostList;
